Как объединить понятия дешево, вкусно и нестандартно? Купить крендель в пекарне Auntie Anne’s! А лучше – несколько свежеиспеченных кренделей, которых хватит на всю компанию и еще останется тем, кто опоздал на вечеринку.

Работаем для вас всю неделю. Для тех, кому не хочется никуда идти, действует доставка на дом, оформить которую можно у нас в приложении. Заказывайте онлайн, чтобы легендарные крендели тетушки Энн успели как раз к началу вашей вечеринки!

Свежая горячая выпечка домой и с собой
Выбирайте крендели по душе, а сотрудники Auntie Anne’s отправят их прямиком в офис или другое удобное для вас место в черте Петропавловска-Камчатского и Москвы. Основные позиции в меню:

• крендели – с чесноком и сметаной,с грецким орехом, корицей или говяжьей пепперони;
• стиксы – с начинкой из сливочного сыра, посыпанные корицей или миндалем;
• крендель-доги – с сыром, перцем халапеньо или говяжьей пепперони;
• пицца – на оригинальном тесте с фирменным соусом Маринара, сыром Моцарелла, сочными томатами, с грибами или паприкой, с пепперони или хрустящим беконом.

Способы оплаты: с нами можно расплатиться онлайн, наличными или картой через переносной терминал у курьера.

We offer to you a lot of tasty baking recipes: cake recipes, muffin recipes, pie recipes, sweet roll recipes, cheesecake recipes, cookie recipes, cupcake recipes and other tasty baking.
All baking recipes are presented in the application with simple and detailed instructions.

All baking recipes are presented with simple instructions and photos.

You can choose your liked recipes and keep them in your favorites. 

You also can use a shopping list. Just add the desired product directly from the recipe to the shopping list. 

The application does not require the Internet and your favorite recipes will always be with you, even when you have not Internet connection!

All baking recipes are divided into the categories for easy use.

All recipes are presented with photos for quickly selection. 
You can find a recipe for your mood! There is simple searching in the app by the name or by the ingredients. Easy recipes using ingredients you already have in the kitchen. The majority of recipes we offer can be both prepared and cooked in 40 minutes or less, from start to finish.

We offer to you a lot recipes of: 

•	Delicious recipes of baking cakes: cream recipes of cakes, fruit cake recipes, chocolate cake recipes, classic cake recipes, recipes of classic biscuits, etc .;

•	Recipes of baking pies and casseroles: recipes of cheesecakes, casseroles recipes with fruits, recipes of sweet simple cheesecakes, recipes of strawberry cheesecakes, recipes of blueberry cheesecakes, etc .;

•	Recipes of cakes and rolls: small cupcake recipes, muffin recipes, cream cake recipes, recipes of muffin with berry and fruit, fruit roll recipes, etc .;

•	Cookie recipes: a lot of baking cookies, marshmallow recipes, recipes of pancakes, cake recipes, recipes of bagels, recipes of cake biscuits and pastries;

•	Baking recipes of cheesecakes;
•	Recipes of homemade cakes;
•	Recipes of layered pastries;
•	Simple baking recipes;
•	Recipes of sweet pastries;
•	Recipes of bread and much more!

Cook with pleasure!
